import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function UserProfile() {
  return (
    <Row callName="userNameBody">
      <Col> <img className="mainLogo" src="logo.png" /> </Col>
      <Col><h1>Dekempsy4</h1></Col>
    </Row>
  );
}
function HistoryBar() {
  return (
    <div>
      Hello
    </div>
  );
}

function BackButton() {
  return (
    <div>
      Hello
    </div>
  );
}

function ProfileSideBar() {
  return (
    <Container fluid="xs" className="sideBar">
      <UserProfile />
    </Container>
  );
}


function App() {

  return (
    <Container fluid="xs">
      <Row xs={12}>
        <Col xs={3}> <ProfileSideBar /> </Col>
        <Col> Hi </Col>
      </Row>
    </Container>
  );
}

export default App;
